// Статистика:
// - сколько было названо городов
// - сколько пропусков



// Массив город _ номер страны
let city_countryNumber = [];
// Массив город _ название города
let city_cityName = [];

// Массив страна _ номер страны
let country_countryNumber = [];
// Массив страна _ название страны
let country_countryName = [];

// Индексы использованных городов
let idUsedCities = [];

// Счёт игрока
let score = 0;

// Функция получения рандомного числа
function getRandomInt(min, max) {
    min = Math.round(min);
    max = Math.round(max);

    return Math.floor(Math.random() * (max - min)) + min;
}

// Индекс города, выбранного игрой
let gameCityIndex;
// Индекс города, выбранного игроком
let playerCityIndex = -1;

// Настройка игры при загрузке страницы
window.onload = function() {
    // Заполнение массивов городов
    let arrCities = file.split(',');
    for(let i = 0; i < arrCities.length; i += 2) {
        city_countryNumber.push(arrCities[i]);
        city_cityName.push(arrCities[i + 1]);
    }

    // Заполнение массивов стран
    let arrCountries = file2.split(',');
    for(let i = 0; i < arrCountries.length; i += 2) {
        country_countryNumber.push(arrCountries[i]);
        country_countryName.push(arrCountries[i + 1]);
    }

    // Игра выбирает первый город
    ChooseCity();
};

// Создать сообщение
function CreateMessage(error) {
    document.getElementsByClassName("check_answer")['answer'].innerHTML = error;
}

// Изменить количество очков, обновить текстовое поле
function ScoreChange(scoreRatio, text) {
    CreateMessage(text);

    score += scoreRatio;
    document.querySelector("#score span").innerHTML = score;
}

// Стоимость пропуска хода
const citySkipCost = 3;
// Функция выбора города игрой
function ChooseCity(skip=false) {
    // Нажатие по кнопке "пропустить" вызывает функцию с аргументом true
    if (skip) {
        // Если очков больше, чем стоимость пропуска хода
        if (score >= citySkipCost) {
            // Обновление счёта
            ScoreChange(-citySkipCost, `${document.getElementById("answer").innerHTML} пропущен! -${citySkipCost}`);
        } else {
            return CreateMessage(`Для пропуска хода нужно 3 очка!`);
        }
    }
    // Выбирает рандомный город из списка
    gameCityIndex = getRandomInt(0, city_countryNumber.length);

    // Все ли города были использованы?
    if (idUsedCities.length < city_countryNumber.length) {
        let can = false;
        while(!can) {
            // Был ли выбранный город использован
            can = !isCityUsed(gameCityIndex);
            if (!can) {
                // Если да, выбрать другой
                gameCityIndex = getRandomInt(0, city_countryNumber.length);
            } else {
                // Если нет, начинается ли название города на букву, на которую заканчивается название предыдущего?
                if ((playerCityIndex > -1) && 
                (GetLastSymbol(city_cityName[playerCityIndex])[0].toUpperCase() != 
                GetFirstSymbol(city_cityName[gameCityIndex]).toUpperCase())) {
                    // Если да, выбрать другой
                    can = false;
                    gameCityIndex = getRandomInt(0, city_countryNumber.length);
                }
            }
        }
        // Добавить индекс города в массив использованных городов
        idUsedCities.push(gameCityIndex);
    } else {
        CreateMessage("Все города были использованы.");
    }
    
    // Определяет, в какой стране находится выбранный город
    let countryIndex;
    for(let i = 0; i < country_countryNumber.length; i ++) {
        if (country_countryNumber[i] == city_countryNumber[gameCityIndex]) {
            countryIndex = i;
            break;
        }
    }
    // Находит последнюю букву слова и окружает тегом span
    let city_name_word = []
    for (let i = 0; i < city_cityName[gameCityIndex].length; i++) {
    	if (i == GetLastSymbol(city_cityName[gameCityIndex])[1]) {
    		city_name_word.push(`<span>${GetLastSymbol(city_cityName[gameCityIndex])[0]}</span>`)
    	} else {
    		city_name_word.push(city_cityName[gameCityIndex][i])
    	}
    }

    // Отображение информации о нынешнем городе (страна города)
    document.getElementById("answer").innerHTML = `${city_name_word.join('')} (${country_countryName[countryIndex]})`;
}

// Был ли использован город?
function isCityUsed(cityIndex) {
    for(let i = 0; i < idUsedCities.length; i++) {
        if (idUsedCities[i] == cityIndex) {
            return true;
        }
    }
    return false;
}

// Получить последний символ города
function GetLastSymbol(text) {
    let ratio = 1;
    // Содержит список ['буква', её индекс в слове]
    let result = [Array.from(text)[text.length - ratio], text.length - ratio];
    // Если последний символ "ыьъй()" - взять следующий символ
    while( (result[0] == "ы") || (result[0] == "ь") || (result[0] == "ъ") || (result[0] == "й")  || (result[0] == "(")  || (result[0] == ")") ) {
        ratio++;
        result = [Array.from(text)[text.length - ratio], text.length - ratio];
    }
    return result;
}
// Получить первый символ города
function GetFirstSymbol(text) {
    return Array.from(text)[0];
}

// Функция нажатия на кнопку ответа
function SubmitAnswer() {
    // Получить ответ
    let answer = document.getElementsByClassName("your_answer")['answer'].innerHTML.toString().replace(/&nbsp;/g,'').trim();
    // Проверки ответа
    // Пустое ли поле?
    if (answer != "") {
        // Совпадает ли первый и последний символ?
        if (GetLastSymbol(city_cityName[gameCityIndex])[0].toUpperCase() == GetFirstSymbol(answer).toUpperCase()) {
            // Существует ли такой город?
            let cityIndex = -1;
            for(let i = 0; i < city_cityName.length; i++) {
                if (city_cityName[i].toUpperCase() == answer.toUpperCase()) {
                    cityIndex = i;
                    break;
                }
            }

            if (cityIndex > -1) {
                // Использовался ли он?
                if (!isCityUsed(cityIndex)) {
                    // Обновление индекса города, выбранного игроком
                    playerCityIndex = cityIndex;
                    // Добавление города в использованные города
                    idUsedCities.push(cityIndex);

                    // Обновление счёта
                    ScoreChange(1, `${city_cityName[cityIndex]} принят! +1`);
                    // Очистка поля для ответа
                    document.getElementsByClassName("your_answer")['answer'].innerHTML = "";

                    // Выбор нового города игрой
                    ChooseCity();
                } else {
                    CreateMessage("Этот город уже использовался");
                }
            } else {
                CreateMessage("Такого города нет");
            }
        } else {
            CreateMessage("Ваш город начинается не на ту букву");
        }
    } else {
        CreateMessage("Введите ответ в поле для ответа");
    }
}

